商品の特徴<br>＊はじめて利用する猫ちゃんでも違和感なく飲める飲み口にこだわって作られています。<br>＊たまった水も飲めるので、停電時でも安心です。<br>＊容器の中を見るだけで、補給タイミングがわかります。<br>＊余分なコードは本体に収納できるます。<br>＊フィルターで水道水を濾過し、キレイでおいしい水を作る循環式給水器です。<br>＊ポンプで水を循環させ、水中に酸素を取り込み新鮮でおいしい水を維持。<br>＊フィルターで食べカス、被毛、ホコリをシャットアウト。<br>＊イオン交換樹脂と高性能活性炭のコンビネーションで水道水を軟水化。<br>＊ネコちゃんがいたずらしても安心な12Vの定電圧仕様。コード保護チューブ付き。<br>＊お手入れは通常、１週間に１回程度でOKです。<br>＊懐にもやさしい、低消費電力設計です。１か月電気代　約43円。<br><br>対象猫種；全猫種<br>対象年齢；全年齢<br><br>商品区分；給水器<br><br>内容；本体、軟水化フィルター1枚、コード保護チューブ<br>サイズ；約210×210×高さ100mm<br>定格電圧；AC100V　50/60Hz<br>流量；2.4L/分(50Hz)　2.8L/分(60Hz)<br>定格水量；950mL<br>電源コード；約1.7m　*コード保護チューブ約50cm付き<br>使用電源；AC100V　50/60Hz<br>生産国；中国<br>保証；メーカー1年保証<br><br>材質；本体；ABS樹脂、フィルター；ポリプロピレン、活性炭、ポリエチレン<br><br><br>低価格販売＝低コスト運営のためにご協力お願いいたします。<br><font color="red"><b>―――――――――――――――――――――――――――――――――――――</b></font><br>ご注文1件を1個口でお送りさせていただくため、<br><font color="red"><b>ご注文1件の「配送重量」合計は、「140」以下でお願いいたします。<br><br>商品1個あたりの「配送重量」は、商品名の前の【】の中に数字で記載しております。</b></font><br>例；【10】商品名 の場合、その商品1個あたりの「配送重量」は「10」となります。<br><br>＊「配送重量」は、送料を求めるための単位で実際の商品重量とは異なります。<br>＊ご注文1件の「配送重量」合計が「141」以上の場合、140毎に送料を加算させていただきます。<br><font color="red"><b>―――――――――――――――――――――――――――――――――――――</b></font><br>ご注文確定前に、今一度、ご注文内容、配送先情報の確認をお願いいたします。 <br><br><style type="text/css">

